import { HttpRequest as Request, HttpResponse as Response, Next } from '../types';
import { Any } from '@heronjs/common/consts';
import { RuntimeError } from '@heronjs/common/errors';
import { Interceptor } from '@heronjs/common';
export interface ExpressInterceptor extends Interceptor {
    (req: Request, res: Response, next: Next): Any;
}
export interface ExpressErrorInterceptor extends Interceptor {
    (err: RuntimeError, req: Request, res: Response, next: Next): Any;
}
